import React, { useState, useEffect } from 'react';
import api from '../../api/endpoint';
import { FiCalendar, FiClock, FiUser, FiMapPin } from 'react-icons/fi';

const MesRendezVous = () => {
  const [rendezVous, setRendezVous] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    loadRendezVous();
  }, []);

  const loadRendezVous = async () => {
    try {
      setLoading(true);
      setError(null);
      const data = await api.getData('/rendezvous/patient');
      setRendezVous(Array.isArray(data) ? data : []);
    } catch (err) {
      console.error('Erreur RDV:', err);
      setError(err.message || 'Impossible de charger les rendez-vous.');
      setRendezVous([]);
    } finally {
      setLoading(false);
    }
  };

  const getStatusColor = (statut) => {
    switch (statut) {
      case 'CONFIRME': return 'bg-green-100 text-green-800';
      case 'EN_ATTENTE': return 'bg-yellow-100 text-yellow-800';
      case 'ANNULE': return 'bg-red-100 text-red-800';
      default: return 'bg-gray-100 text-gray-800';
    }
  };

  if (loading) {
    return (
      <div className="min-h-screen flex items-center justify-center bg-gray-50">
        <div className="text-center">
          <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-blue-500 mx-auto mb-4"></div>
          <p>Chargement des rendez-vous...</p>
        </div>
      </div>
    );
  }

  return (
    <div className="p-6 max-w-6xl mx-auto">
      <div className="mb-8">
        <h1 className="text-3xl font-bold text-gray-900 mb-2">Mes Rendez-vous</h1>
        <p className="text-gray-600">Gérez vos rendez-vous médicaux</p>
      </div>

      {error && (
        <div className="bg-red-50 border border-red-200 text-red-800 px-6 py-4 rounded-xl mb-6">
          {error}
        </div>
      )}

      {rendezVous.length === 0 ? (
        <div className="text-center py-20 bg-white rounded-xl shadow-sm border border-gray-100">
          <FiCalendar className="h-16 w-16 text-gray-300 mx-auto mb-4" />
          <h3 className="text-xl font-semibold text-gray-900 mb-2">Aucun rendez-vous</h3>
          <p className="text-gray-500 mb-6">Vos rendez-vous apparaîtront ici</p>
          <button 
            onClick={loadRendezVous}
            className="bg-blue-600 text-white px-6 py-2 rounded-xl hover:bg-blue-700 transition"
          >
            Actualiser
          </button>
        </div>
      ) : (
        <div className="grid gap-4">
          {rendezVous.map((rdv) => (
            <div key={rdv.id} className="bg-white p-6 rounded-xl shadow-sm border border-gray-100 hover:shadow-md transition">
              <div className="flex justify-between items-start mb-4">
                <span className={`px-3 py-1 rounded-full text-xs font-medium ${getStatusColor(rdv.statut || 'EN_ATTENTE')}`}>
                  {rdv.statut || 'EN_ATTENTE'}
                </span>
                <div className="text-right">
                  <FiClock className="h-4 w-4 text-gray-400 inline mr-1" />
                  <span className="text-sm font-medium">{rdv.heure || 'Non spécifiée'}</span>
                </div>
              </div>
              <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
                <div>
                  <h3 className="text-lg font-semibold text-gray-900 mb-2">{rdv.medecin || 'Médecin'}</h3>
                  <div className="flex items-center text-gray-600 mb-2">
                    <FiMapPin className="h-4 w-4 mr-2" />
                    <span>{rdv.service || 'Service'}</span>
                  </div>
                  <p className="text-sm text-gray-500">Date: {rdv.date || 'Non spécifiée'}</p>
                </div>
                <div className="text-right md:text-left">
                  <p className="text-sm font-medium text-gray-900">{rdv.lieu || 'Cabinet médical'}</p>
                </div>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default MesRendezVous;
